import React, { useState } from "react";
import styled from "styled-components";
import {
  Switch,
  Route,
  Link,
  useRouteMatch,
  useParams,
} from "react-router-dom";

function Order() {
  return (
    <div>
      <h2>Build Your Own Pizza</h2>
      <img src="https://media.istockphoto.com/id/184996591/tr/foto%C4%9Fraf/greek-pizza.jpg?s=612x612&w=0&k=20&c=_x1kSEKiI7L28wZslzDSDhdUniLpWXLz1LlnWalwrQE=" />

      <form>
        <br />
        <h3>Build Your Own Pizza</h3>
        <br />
        <label htmlFor="size"> Choice of Size</label>
        <br />
        <br />
        <select id="size">
          <option value="small">Small</option>
          <option value="medium">Medium</option>
          <option value="large">Large</option>
          <option value="extra_large">Extra Large</option>
        </select>
        <label>Choice of Sauce</label>
        <input id="original_red" type="radio" />
        <label htmlFor="original_red">Original Red</label>
      </form>
    </div>
  );
}

export default Order;
